INSERT INTO `ij4xw_content` VALUES (1,101,'Test_1','test-1','<p>Testing material №1</p>','',1,2,'2024-09-11 05:55:22',769,'','2024-09-11 05:55:22',769,769,'2024-11-20 06:04:49','2024-09-11 05:55:22',NULL,'{\"image_intro\":\"\",\"image_intro_alt\":\"\",\"float_intro\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"float_fulltext\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":\"\",\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":\"\",\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":\"\",\"urlctext\":\"\",\"targetc\":\"\"}','{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,1,'','',1,0,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\"}',0,'*',''),(2,117,'    Сибай \"Тәҡүә\" мәсетендә балалар өсөн Ҡорбан байрамы ойошторолдо.','sibaj-t-m-setend-balalar-s-n-orban-bajramy-ojoshtoroldo','<p style=\"text-align: left;\">    Сибай \"Тәҡүә\" мәсетендә балалар өсөн Ҡорбан байрамы ойошторолдо.</p>\r\n<p style=\"text-align: left;\">    Байрамға килгән 90 яҡын баланы 3 командаға бүлеп (Әбү Бәкр, Ғүмәр, Ғәли исемле командалар) Ислам, иман, пәйғәмбәрҙәр тарихы темаһына квест уйын ойошторолған ине. Уйын аҙағында һәр команда үҙенә тәғәйенләнгән \"хазинаны\" табып шатланды.</p>\r\n<p style=\"text-align: left;\">    Балаларға бындай фәһемле лә, мауыҡтырғыс та уйын бик оҡшаны.</p>\r\n<p style=\"text-align: left;\">    Һуңынан балалар былау һәм тәмлекәстәр менән һыйланып, төрлө бүләктәр алып, ҡәнәғәт ҡалып таралышты. Байрамда төрлө оҫталыҡ дәрестәре лә күрһәтелде.</p>\r\n<p style=\"text-align: left;\">    Байрамды ойоштороусылар: мәсет имам-хатибы Әғләмүддин хәҙрәткә, квест сценарияһын төҙөүсе Ноғоманова-Ғәзизова Әминә ханымға, ярҙамсылар Янышева Оксана ханымға, Ғәзизова Миңлегөл ханымға, Ноғоманов Ә. С., Ноғоманова Ф. Ә., Ноғоманов М. Ә., шулай уҡ Мухамадов Х. И., Рафиҡова Диләра ханымға ҙур рәхмәттәребеҙҙе белдерәбеҙ.</p>\r\n<p style=\"text-align: left;\">    Шулай уҡ байрамға матди яҡтан ярҙам итеүселәр: \"Ихсан\" китап һәм мосолман кейемдәре магазины (Ғәзизов Ә. Ә., Ғәзизова М. Х.), \"Карандаш\" канцтауарҙары магазины (Йәнтүрин Р. Р.), \"Тәүхид\" мосолман кейемдәре магазины (Тапакова А. Ф.), \"Ағиҙел\" бистроһы (Казакбаев С. Р.), \"Сәләм\" кафеһы (Жураев А. А.), \"Күстәнәс\" кафеһы (Юнысбаева Г. А.), мәҙәниәт һәм ял паркы (Ахметшин И. А.), \"Тәсним\" китап һәм мосолман кейемдәре магазины (Ишкильдина Ф. И.), \"Ғимран\" китап һәм кейемдәр магазины (Суюшева Г. Р.).</p>\r\n<p style=\"text-align: left;\">    Балаларҙы былау бешереп һыйлаусы ашнаҡсылар: Ғәзизов Ғабдулла, Иҫәнғолов Рамаҙан һәм Ишемғолова Рәйзә дин ҡәрҙәштәребеҙгә ҙур рәхмәт.</p>\r\n<p style=\"text-align: left;\">    Аллаһү Тәғәлә балаларыбыҙ өсөн ошондай күркәм һәм файҙалы байрам ойоштороусыларға һаулыҡ, эштәрендә уңыштар, тормоштарында тик шатлыҡ-ҡыуаныстар ғына насип итһен ине.</p>','',1,2,'2024-11-27 08:30:23',769,'','2024-11-27 08:30:23',769,NULL,NULL,'2024-11-27 08:30:23',NULL,'{\"image_intro\":\"\",\"image_intro_alt\":\"\",\"float_intro\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"float_fulltext\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":\"\",\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":\"\",\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":\"\",\"urlctext\":\"\",\"targetc\":\"\"}','{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"helix_ultimate_image\":\"\",\"helix_ultimate_image_alt_txt\":\"\",\"helix_ultimate_article_format\":\"standard\",\"helix_ultimate_audio\":\"\",\"helix_ultimate_gallery\":\"\",\"helix_ultimate_video\":\"\"}',1,0,'','',1,0,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\"}',0,'*','');
