guage\";a:1:{i:0;O:8:\"stdClass\":6:{s:5:\"title\";s:1:\"*\";s:5:\"state\";i:1;s:6:\"access\";i:1;s:8:\"language\";s:0:\"\";s:6:\"nested\";b:0;s:2:\"id\";i:9;}}}i:16;s:14:\"История\";i:17;i:4;i:18;s:49:\"index.php?option=com_newsfeeds&view=newsfeed&id=3\";}'),(9,'index.php?option=com_content&view=article&id=2','index.php?option=com_content&view=article&id=2:sibaj-t-m-setend-balalar-s-n-orban-bajramy-ojoshtoroldo&catid=2','    Сибай \"Тәҡүә\" мәсетендә балалар өсөн Ҡорбан байрамы ойошторолдо.',' Сибай \"Тәҡүә\" мәсетендә балалар өсөн Ҡорбан байрамы ойошторолдо. Байрамға килгән 90 яҡын баланы 3 командаға бүлеп (Әбү Бәкр, Ғүмәр, Ғәли исемле командалар) Ислам, иман, пәйғәмбәрҙәр тарихы темаһына квест уйын ойошторолған ине. Уйын аҙағында һәр команда үҙенә тәғәйенләнгән \"хазинаны\" табып шатланды. Балаларға бындай фәһемле лә, мауыҡтырғыс та уйын бик оҡшаны. Һуңынан балалар былау һәм тәмлекәстәр менән һыйланып, төрлө бүләктәр алып, ҡәнәғәт ҡалып таралышты. Байрамда төрлө оҫталыҡ дәрестәре лә күрһәтелде. Байрамды ойоштороусылар: мәсет имам-хатибы Әғләмүддин хәҙрәткә, квест сценарияһын төҙөүсе Ноғоманова-Ғәзизова Әминә ханымға, ярҙамсылар Янышева Оксана ханымға, Ғәзизова Миңлегөл ханымға, Ноғоманов Ә. С., Ноғоманова Ф. Ә., Ноғоманов М. Ә., шулай уҡ Мухамадов Х. И., Рафиҡова Диләра ханымға ҙур рәхмәттәребеҙҙе белдерәбеҙ. Шулай уҡ байрамға матди яҡтан ярҙам итеүселәр: \"Ихсан\" китап һәм мосолман кейемдәре магазины (Ғәзизов Ә. Ә., Ғәзизова М. Х.), \"Карандаш\" канцтауарҙары магазины (Йәнтүрин Р. Р.), \"Тәүхид\" мосолман кейемдәре магазины (Тапакова А. Ф.), \"Ағиҙел\" бистроһы (Казакбаев С. Р.), \"Сәләм\" кафеһы (Жураев А. А.), \"Күстәнәс\" кафеһы (Юнысбаева Г. А.), мәҙәниәт һәм ял паркы (Ахметшин И. А.), \"Тәсним\" китап һәм мосолман кейемдәре магазины (Ишкильдина Ф. И.), \"Ғимран\" китап һәм кейемдәр магазины (Суюшева Г. Р.). Балаларҙы былау бешереп һыйлаусы ашнаҡсылар: Ғәзизов Ғабдулла, Иҫәнғолов Рамаҙан һәм Ишемғолова Рәйзә дин ҡәрҙәштәребеҙгә ҙур рәхмәт. Аллаһү Тәғәлә балаларыбыҙ өсөн ошондай күркәм һәм файҙалы байрам ойоштороусыларға һаулыҡ, эштәрендә уңыштар, тормоштарында тик шатлыҡ-ҡыуаныстар ғына насип итһен ине. ','2024-11-27 08:30:23','8f3bb40fdb9e093c4b2838944a06cc0a',1,0,1,'*','2024-11-27 08:30:23',NULL,'2024-11-27 08:30:23',NULL,0,0,3,_binary 'O:52:\"Joomla\\Component\\Finder\\Administrator\\Indexer\\Result\":19:{i:0;i:1;i:1;s:5:\"ru-RU\";i:2;s:2933:\" Сибай \"Тәҡүә\" мәсетендә балалар өсөн Ҡорбан байрамы ойошторолдо. Байрамға килгән 90 яҡын баланы 3 командаға бүлеп (Әбү Бәкр, Ғүмәр, Ғәли исемле командалар) Ислам, иман, пәйғәмбәрҙәр тарихы темаһына квест уйын ойошторолған ине. Уйын аҙағында һәр команда үҙенә тәғәйенләнгән \"хазинаны\" табып шатланды. Балаларға бындай фәһемле лә, мауыҡтырғыс та уйын бик оҡшаны. Һуңынан балалар былау һәм тәмлекәстәр менән һыйланып, төрлө бүләктәр алып, ҡәнәғәт ҡалып таралышты. Байрамда төрлө оҫталыҡ дәрестәре лә күрһәтелде. Байрамды ойоштороусылар: мәсет имам-хатибы Әғләмүддин хәҙрәткә, квест сценарияһын төҙөүсе Ноғоманова-Ғәзизова Әминә ханымға, ярҙамсылар Янышева Оксана ханымға, Ғәзизова Миңлегөл ханымға, Ноғоманов Ә. С., Ноғоманова Ф. Ә., Ноғоманов М. Ә., шулай уҡ Мухамадов Х. И., Рафиҡова Диләра ханымға ҙур рәхмәттәребеҙҙе белдерәбеҙ. Шулай уҡ байрамға матди яҡтан ярҙам итеүселәр: \"Ихсан\" китап һәм мосолман кейемдәре магазины (Ғәзизов Ә. Ә., Ғәзизова М. Х.), \"Карандаш\" канцтауарҙары магазины (Йәнтүрин Р. Р.), \"Тәүхид\" мосолман кейемдәре магазины (Тапакова А. Ф.), \"Ағиҙел\" бистроһы (Казакбаев С. Р.), \"Сәләм\" кафеһы (Жураев А. А.), \"Күстәнәс\" кафеһы (Юнысбаева Г. А.), мәҙәниәт һәм ял паркы (Ахметшин И. А.), \"Тәсним\" китап һәм мосолман кейемдәре магазины (Ишкильдина Ф. И.), \"Ғимран\" китап һәм кейемдәр магазины (Суюшева Г. Р.). Балаларҙы былау бешереп һыйлаусы ашнаҡсылар: Ғәзизов Ғабдулла, Иҫәнғолов Рамаҙан һәм Ишемғолова Рәйзә дин ҡәрҙәштәребеҙгә ҙур рәхмәт. Аллаһү Тәғәлә балаларыбыҙ өсөн ошондай күркәм һәм файҙалы байрам ойоштороусыларға һаулыҡ, эштәрендә уңыштар, тормоштарында тик шатлыҡ-ҡыуаныстар ғына насип итһен ине. \";i:3;a:25:{s:2:\"id\";i:2;s:5:\"alias\";s:55:\"sibaj t m setend balalar s n orban bajramy ojoshtoroldo\";s:7:\"summary\";s:3254:\"<p style=\"text-align: left;\">    Сибай \"Тәҡүә\" мәсетендә балалар өсөн Ҡорбан байрамы ойошторолдо.</p>\r\n<p style=\"text-align: left;\">    Байрамға килгән 90 яҡын баланы 3 командаға бүлеп (Әбү Бәкр, Ғүмәр, Ғәли исемле командалар) Ислам, иман, пәйғәмбәрҙәр тарихы темаһына квест уйын ойошторолған ине. Уйын аҙағында һәр команда үҙенә тәғәйенләнгән \"хазинаны\" табып шатланды.</p>\r\n<p style=\"text-align: left;\">    Балаларға бындай фәһемле лә, мауыҡтырғыс та уйын бик оҡшаны.</p>\r\n<p style=\"text-align: left;\">    Һуңынан балалар былау һәм тәмлекәстәр менән һыйланып, төрлө бүләктәр алып, ҡәнәғәт ҡалып таралышты. Байрамда төрлө оҫталыҡ дәрестәре лә күрһәтелде.</p>\r\n<p style=\"text-align: left;\">    Байрамды ойоштороусылар: мәсет имам-хатибы Әғләмүддин хәҙрәткә, квест сценарияһын төҙөүсе Ноғоманова-Ғәзизова Әминә ханымға, ярҙамсылар Янышева Оксана ханымға, Ғәзизова Миңлегөл ханымға, Ноғоманов Ә. С., Ноғоманова Ф. Ә., Ноғоманов М. Ә., шулай уҡ Мухамадов Х. И., Рафиҡова Диләра ханымға ҙур рәхмәттәребеҙҙе белдерәбеҙ.</p>\r\n<p style=\"text-align: left;\">    Шулай уҡ байрамға матди яҡтан ярҙам итеүселәр: \"Ихсан\" китап һәм мосолман кейемдәре магазины (Ғәзизов Ә. Ә., Ғәзизова М. Х.), \"Карандаш\" канцтауарҙары магазины (Йәнтүрин Р. Р.), \"Тәүхид\" мосолман кейемдәре магазины (Тапакова А. Ф.), \"Ағиҙел\" бистроһы (Казакбаев С. Р.), \"Сәләм\" кафеһы (Жураев А. А.), \"Күстәнәс\" кафеһы (Юнысбаева Г. А.), мәҙәниәт һәм ял паркы (Ахметшин И. А.), \"Тәсним\" китап һәм мосолман кейемдәре магазины (Ишкильдина Ф. И.), \"Ғимран\" китап һәм кейемдәр магазины (Суюшева Г. Р.).</p>\r\n<p style=\"text-align: left;\">    Балаларҙы былау бешереп һыйлаусы ашнаҡсылар: Ғәзизов Ғабдулла, Иҫәнғолов Рамаҙан һәм Ишемғолова Рәйзә дин ҡәрҙәштәребеҙгә ҙур рәхмәт.</p>\r\n<p style=\"text-align: left;\">    Аллаһү Тәғәлә балаларыбыҙ өсөн ошондай күркәм һәм файҙалы байрам ойоштороусыларға һаулыҡ, эштәрендә уңыштар, тормоштарында тик шатлыҡ-ҡыуаныстар ғына насип итһен ине.</p>\";s:4:\"body\";s:0:\"\";s:6:\"images\";s:173:\"{\"image_intro\":\"\",\"image_intro_alt\":\"\",\"float_intro\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"float_fulltext\":\"\",\"image_fulltext_caption\":\"\"}\";s:5:\"catid\";i:2;s:10:\"created_by\";i:769;s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2024-11-27 08:30:23\";s:11:\"modified_by\";i:769;s:6:\"params\";O:24:\"Joomla\\Registry\\Registry\":3:{s:7:\"\0*\0data\";O:8:\"stdClass\":87:{s:14:\"article_layout\";s:9:\"_:default\";s:10:\"show_title\";s:1:\"1\";s:11:\"link_titles\";s:1:\"1\";s:10:\"show_intro\";s:1:\"1\";s:19:\"info_block_position\";s:1:\"0\";s:21:\"info_block_show_title\";s:1:\"1\";s:13:\"show_category\";s:1:\"1\";s:13:\"link_category\";s:1:\"1\";s:20:\"show_parent_category\";s:1:\"0\";s:20:\"link_parent_category\";s:1:\"0\";s:17:\"show_associations\";s:1:\"0\";s:5:\"flags\";s:1:\"1\";s:11:\"show_author\";s:1:\"1\";s:11:\"link_author\";s:1:\"0\";s:16:\"show_create_date\";s:1:\"0\";s:16:\"show_modify_date\";s:1:\"0\";s:17:\"show_publish_date\";s:1:\"1\";s:20:\"show_item_navigation\";s:1:\"1\";s:13:\"show_readmore\";s:1:\"1\";s:19:\"show_readmore_title\";s:1:\"1\";s:14:\"readmore_limit\";i:100;s:9:\"show_tags\";s:1:\"1\";s:11:\"record_hits\";s:1:\"1\";s:9:\"show_hits\";s:1:\"1\";s:11:\"show_noauth\";s:1:\"0\";s:13:\"urls_position\";i:0;s:7:\"captcha\";s:0:\"\";s:23:\"show_publishing_options\";s:1:\"1\";s:20:\"show_article_options\";s:1:\"1\";s:27:\"show_configure_edit_options\";s:1:\"1\";s:16:\"show_permissions\";s:1:\"1\";s:22:\"show_associations_edit\";s:1:\"1\";s:12:\"save_history\";s:1:\"1\";s:13:\"history_limit\";i:10;s:25:\"show_urls_images_frontend\";s:1:\"0\";s:24:\"show_urls_images_backend\";s:1:\"1\";s:7:\"targeta\";i:0;s:7:\"targetb\";i:0;s:7:\"targetc\";i:0;s:11:\"float_int